    <div>
      {isLoading ? (
        <div>Designation: Internee
        Name: Nabeelah Maryam
        Father Name: Zahoor Ilahi
        Contact1: 0326-6847004
        contact2: 0348-2727909
        DOB: 17-10-2000
        CNIC: 38401-2769384-4
        Education: BS software Engg
        Address: Aziz Bhatti town Sargodha</div>
      ) : (
        <>
          <div>Content loaded!</div>
        </>
      )}
    </div>
  );
};

export default Preloader;
